/**
 * Proyect View
 *
 * This is the container that has all actions and components related
 * to de Proyect View, were we manage our proyects.
 *
 */

 import React from 'react';

 export default function ProyectView() {
   return (
     <div>
           <h1>Vista de proyectos</h1>
           <h2>
            Aquí estarán los filtros para los proyectos y se  <br />verán en una linea de tiempo junto a otras acciones.
           </h2>
    </div>

   );
 }
